import React, { Component } from "react";
import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import LandingScreen from "./components/auth/Landing";
import RegisterScreen from "./components/auth/Register";

import * as firebase from "firebase";

const firebaseConfig = {
  apiKey: "AIzaSyBYtXH5NrvKBCL1jpP34hA2k2H5sBXtWWk",
  authDomain: "react-instagram-clone-ab215.firebaseapp.com",
  projectId: "react-instagram-clone-ab215",
  storageBucket: "react-instagram-clone-ab215.appspot.com",
  messagingSenderId: "236163644797",
  appId: "1:236163644797:web:c7b786b14399638bd36014",
};

if (firebase.apps.length === 0) {
  firebase.initializeApp(firebaseConfig);
}

const Stack = createStackNavigator();

export class App extends Component {
  render() {
    return (
      <NavigationContainer>
        <Stack.Navigator initialRouteName="Landing">
          <Stack.Screen
            name="Landing"
            component={LandingScreen}
            options={{ headerShown: false }}
          />
          <Stack.Screen name="Register" component={RegisterScreen} />
        </Stack.Navigator>
      </NavigationContainer>
    );
  }
}

export default App;
